import {Fragment} from 'react'

const ListExperience = (experienceType) => {
  const myExperienceType = {experienceType}
  return (
    <Fragment>
      {experienceType}
      <p>List of experience {myExperienceType}</p>
    </Fragment>
  )
}

export default ListExperience
